    <div>
    <h1 class="heading_style">List of Netflix Series 2021</h1>

    <Card 
        sname = {Sdata[0].sname}
        imgsrc = {Sdata[0].imgsrc}
        title =  {Sdata[0].title}
        link = {Sdata[0].link}
    />
    
    Sdata.map(ncard);

    </div>,
    document.getElementById("root")
);
